                                            {route.title}
                                        </Link>
                                    </NavLink>
                                </NavItem>
                            })
                        }*/}
                        <NavItem>
                            <NavLink>
                                <Link to="/">
                                    Anasayfa
                                </Link>
                            </NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink>
                                <Link to="/hakkinda">
                                    Hakkimizda
                                </Link>
                            </NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink>
                                <Link to="/tur/golden-retriever">
                                    Goldens
                                </Link>
                            </NavLink>
                        </NavItem>





                    </Nav>
                </Collapse>
            </Navbar>
        </div>
    );
};

export default Header;
